import styled from "@emotion/styled";
import React from "react";
import FontDownloadOutlinedIcon from '@mui/icons-material/FontDownloadOutlined';
import { Box, Button, Select, Typography } from "@mui/material";

const AlignedBox = styled(Box)((props) => ({
    display:'flex',
    alignItems:'center',
    marginLeft : props.marginL
}));

const StyledButton = styled(Button)({
    color: 'black',
})

const NotionFreeButton = styled(Button)({
    backgroundColor: 'tomato',
    color: 'white',
    borderRadius:'5px',
    '&:hover': {
        backgroundColor: 'gray',
    },
    height:'30px'
})



function Header(){


    document.body.style.margin = '0';

    return(
        <AlignedBox sx={{ mx: 3}}>
            <AlignedBox>
                <FontDownloadOutlinedIcon sx={{color: 'red'}}/>
                <Typography variant="body2" sx={{}}>Notion</Typography>  
                <StyledButton>
                    <Typography>제품</Typography></StyledButton>
                <StyledButton>다운로드</StyledButton>
                <StyledButton>솔루션</StyledButton>
                <StyledButton>자료</StyledButton>
                <StyledButton>요금제</StyledButton>

            </AlignedBox>

            <AlignedBox marginL="auto">
                <StyledButton>영업팀에 문의하기</StyledButton>
                <StyledButton>로그인</StyledButton>
                <NotionFreeButton>Notion 무료 체험</NotionFreeButton>
            </AlignedBox>
        </AlignedBox>
    );
}

export default Header;
